pragma solidity ^0.4.17;

import 'openzeppelin-solidity/contracts/token/ERC20/StandardToken.sol';

contract TaxiCoin is StandardToken {

string public name = 'TaxiCoin';
string public symbol = 'TXC';
uint8 public decimals = 2;
uint public INITIAL_SUPPLY = 120000;
event PayedForOrder( address indexed spender, uint256 value,uint8 id);
constructor() public {
  totalSupply_ = INITIAL_SUPPLY;
  balances[msg.sender] = INITIAL_SUPPLY;
}
function PayForOrder(address _to, uint256 _value,uint8 _id) public returns (bool) {
    require(_to != address(0));
    require(_value <= balances[msg.sender]);

    balances[msg.sender] = balances[msg.sender].sub(_value);
    balances[_to] = balances[_to].add(_value);
  	emit PayedForOrder(_to, _value,_id);
    return true;
}
function mint() payable external {
  require(msg.value > 0);
  uint numTokens = msg.value;
  totalSupply_ += numTokens;
  balances[msg.sender] += numTokens;
}

}
